Comment:
Not feeling this at all. Just looks like Rowling is stretching out the Potter concept too much... Harry Potter was a fantastic series full of wonder and charm. Everything that made the series work has been taken out of the Fantastic Beasts concept...

Things like its quirky "Britishness";
 - the audience following of three young children growing into adults;
- the audiences own memories of school reflected through Hogwarts; 
- the quirky collection of teachers played by various English celebs;
- the foreboding and darkness that surrounded the Voldemort legend in the first 4 films;
- the transformation from foreboding into a very real threat with Voldemorts return from the 4th film onwards;
- the increasingly dark nature of each film as the series progressed;
- Ralph Fiennes as Volddmort.
- Quidditch.
Remove these things and you remove the essence of what made HP special in the first place.

The only thing remotely interesting in FB is Eddie Redmayne as Newt. That's it. Everything else seems to be pale reflection of the original series. A bit like when Percy Jackson tried to do an "American" version of Harry Potter but just fell flat on its face.

